function Navbar() {
  return (
    <div className="navbar">
      <img src="https://dosnoventabikes.com/wp-content/uploads/2020/09/logo.svg"></img>
      <h3>SHOP</h3>
      <h3>STORIES</h3>
      <h3>COMPANY</h3>
      <div className="nav-personal">
        <h3>ACCOUNT</h3>
        <h3>CART</h3>
      </div>
    </div>
  );
}

export default Navbar;
